import React from 'react';
import ReactDOM from 'react-dom';
import Nav from './nav.js';

const Main = () => (
    <main>
        <h1>John Grohman</h1>
    </main>
)


const App = () => (
    <div className='app'>
        <Main />
        <Nav />
    </div>
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
